import React from 'react';
import susimg from "../../assets/sus.png";

const Sustain=()=>{
 return(
    <div style={{ display: 'flex',justifyContent: 'center',alignItems: 'center',height: '30vh'}}>
        <img style={{width:'115%'}} src={susimg} alt=''/>
    </div>
 )

}
export default Sustain;
